import styled from "styled-components";
import "./App.css";
import { Button } from "react-bootstrap";

const Title = styled.div`
  padding-top: 50px;
  text-align: center;
  font-size: 60px;
  font-family: "Amatic SC", cursive;
`;

const NewTask = styled.div`
  text-align: center;
`;

function App() {
  return (
    <div className="App">
      <Title>Feladatok</Title>
      <div className="New">
        <Button variant="outline-dark">Feladat hozzáadása</Button>
      </div>
      <Button className="All" variant="outline-dark">
        Összes feladat
      </Button>
      <Button className="Completed" variant="outline-dark">
        Teljesített feladatok
      </Button>
      <Button className="Uncompleted" variant="outline-dark">
        Elvégzendő feladatok
      </Button>
    </div>
  );
}

export default App;
